import "./reserveTutorscr.css"

import { useState, useEffect } from 'react';

function TutorTable() {
  const [tutors, setTutors] = useState([]);

  useEffect(() => {
    fetch('https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/show/tutors')
      .then(response => response.json())
      .then(data => setTutors(data))
      .catch(error => console.error(error));
  }, []);

  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Subject</th>
          <th>Rate</th>
        </tr>
      </thead>
      <tbody>
        {tutors.map(tutor => (
          <tr key={tutor.id}>
            <td>{tutor.id}</td>
            <td>{tutor.name}</td>
            <td>{tutor.subject}</td>
            <td>{tutor.rate}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

function ReserveForm() {
  const [formData, setFormData] = useState({
    tutor_id: '',
    student_id: '',
    date: '',
    subject_id: '',
    time: '',
    duration: '',
    status: 'Incomplete'
  });

  const handleChange = event => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = event => {
    event.preventDefault();
    fetch('https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/Create/reservations', {
      method: 'POST',
      body: JSON.stringify({ body: formData })
    })
      .then(response => response.json())
      .then(data => console.log(data))
      .catch(error => console.error(error));
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="tutor_id">Tutor ID:</label>
      <input type="text" id="tutor_id" name="tutor_id" value={formData.tutor_id} onChange={handleChange} required />
      <label htmlFor="student_id">Student ID:</label>
      <input type="text" id="student_id" name="student_id" value={formData.student_id} onChange={handleChange} required />
      <label htmlFor="date">Date:</label>
      <input type="date" id="date" name="date" value={formData.date} onChange={handleChange} required />
      <label htmlFor="subject_id">Subject ID:</label>
      <input type="text" id="subject_id" name="subject_id" value={formData.subject_id} onChange={handleChange} required />
      <label htmlFor="time">Time:</label>
      <input type="time" id="time" name="time" value={formData.time} onChange={handleChange} required />
      <label htmlFor="duration">Duration:</label>
      <input type="number" id="duration" name="duration" value={formData.duration} onChange={handleChange} required />
      <button type="submit">Reserve</button>
    </form>
  );
}

function ReserveTutorPage() {
  return (
    <>
      <h1>Reserve a Tutor</h1>
      <TutorTable />
      <ReserveForm />
    </>
  );
}

export default ReserveTutorPage;
